import { useState } from "react";

const App = () => {
    const [counterValue, setCounter] = useState(0);
    const increment = () => {
        setCounter(counterValue + 1);
    };
    const decrease = () => {
        setCounter(counterValue - 1);
    };
    const reset = () => {
        setCounter(0);
    };

    return (
        <div>
            <h1>{counterValue}</h1>
            <button
                onClick={() => {
                    setCounter(counterValue + 1);
                }}
            >
                increment
            </button>
            <button></button>
        </div>
    );
};

export default App;
